from core.utils import underscore_to_camelcase


class BaseFactory:
    def __getattr__(self, attr):
        """
        Checks for the existing of a create_{model_name_in_underscore} class
        in .models and forwards it to the create_model method.
        """

        if attr.startswith("create_"):
            underscored_classname = attr[7:]
            class_name = underscore_to_camelcase(underscored_classname)
            class_name = class_name[0].upper() + class_name[1:]

            def wrapper(**inner_kwargs):
                return self.create_model(class_name, **inner_kwargs)

            return wrapper

    def create(self, model_cls, defaults, kwargs=None):
        kwargs = kwargs or {}
        return model_cls.objects.create(**dict(defaults, **kwargs))



